    console.log(cards);
    const flowChartCards = cards.filter((item, idx) => item.id == objCards[idx]);
    console.log(flowChartCards, "cards----")
    // let res = alaSQLSpace('SELECT * FROM ? where id  ?', [cards,chartid]);
  }
  render(){
    const {closeFlowChartView} = this.props;
    return (
      <div className='flow-chart-container'>
       <span className='cross-icon-container'><i className="fas fa-times cross-icon" onClick={closeFlowChartView}></i></span> 
      </div>
    )
  }
};
